import projects from './Projects.json'

const Project = () => {
    return(
        <div>
            <h1>projects</h1>
            {
                projects.map(project => {
                    <div className='projectGrid'>
                    return(
                            <div className='project'>
                                <h1>{project.name}</h1>
                                <h2><a href={project.demo} target='#'>{project.name}</a></h2>
                                <h2><a href={project.repository} target='#'>{project.name}</a></h2>
                            </div>
                    )
                        </div>
                })
            }
        </div>
    )
}

export default Project
